                                <td className="text-center">{item.stock}</td>
                                <td className="text-center">{item.precio}</td> */}
                            </tr>

                        ))
                           :
                           <tr></tr> }
                        {/* <tr>
                            <td>1</td>
                            <td>Mark</td>
                            <td>Otto</td>
                            <td>@mdo</td>
                        </tr> */}

                    </tbody>
                </Table>

            </>
        )
    }
}
